INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (0.0, "2020/07/31 12:00:00", 401, 24001, 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 10046, 0.0, 2, "2030/12/17 14:59:59", "アヤネ", 24, 102301, 2);
