INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (0.0, "2020/07/31 12:00:00", 613, 24018, 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 10046, 0.0, 2, "2030/12/17 14:59:59", "ダイチ", 24, 192401, 2);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (0.0, "2020/07/31 12:00:00", 211, 24019, 0.0, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 10046, 4.52, 1, "2030/12/17 14:59:59", "ハツネ", 24, 113401, 2);
